export default function About() {
  return (
    <div className="about-container">
        <div className="about-image"></div>
        <main className="about-content">
            <h1>Don't squeeze in a sedan when you can relax in a luxurious car</h1>
            <p className="about-paragraph">Lorem ipsum dolor sit amet consectetur adipisicing elit. Reprehenderit ipsam et quisquam ratione omnis officia excepturi blanditiis doloribus dolorum. Ex sunt ea non voluptates nam, rem accusamus sequi aliquid voluptatum.</p>
            <div className="about-extra-info">
                <h2>Your destinaton is waiting</h2>
                <h2>You car is ready</h2>
                <button className="about-button">Explore our cars</button>
            </div>
        </main>
    </div>
  );
};
